/**
 * Signals in message BATT_SpeakerClaim_1.
 *
 * Back up speaker handshake signal from pack 1 to pack 2
 *
 * All signal values are as on the CAN bus.
 */
struct abs_bms_nf_batt_speaker_claim_1_t {
    /**
     * Default speaker pack will set this bit to 1.
     * Default speaker pack shall set this signal to 0 in case of BATT_expectedSpeakerID_2 becomes 2.
     *
     * Range: 0..255 (0..255 -)
     * Scale: 1
     * Offset: 0
     */
    uint8_t batt_speaker_claim_flag_1;

    /**
     * Default Speaker pack shall set this signal to 1.
     * Default pack shall set this signal to 2 in case of BATT_expectedSpeakerID_2 becomes 2.
     *
     * Range: 0..255 (0..255 -)
     * Scale: 1
     * Offset: 0
     */
    uint8_t batt_expected_speaker_id_1;

    /**
     * Range: 0..15 (0..15 -)
     * Scale: 1
     * Offset: 0
     */
    uint8_t batt_system_state_1;
};

/**
 * Signals in message BATT_SpeakerClaim_2.
 *
 * All signal values are as on the CAN bus.
 */
struct abs_bms_nf_batt_speaker_claim_2_t {
    /**
     * Backup speaker pack shall set this signal to 0.
     * Backup speaker pack shall set this signal to 1 if BATT_speakerClaimFlag_1 set to 0.
     *
     * Range: 0..255 (0..255 -)
     * Scale: 1
     * Offset: 0
     */
    uint8_t batt_speaker_claim_flag_2;

    /**
     * Backup speaker pack shall set this signal to 1.
     * Backup speaker shall set this signal to 2 in case of default speaker disconnect detected.
     *
     * Range: 0..255 (0..255 -)
     * Scale: 1
     * Offset: 0
     */
    uint8_t batt_expected_speaker_id_2;

    /**
     * Range: 0..15 (0..15 -)
     * Scale: 1
     * Offset: 0
     */
    uint8_t batt_system_state_2;
};

